■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>スリキズがつきにくい、長く愛用できる防災フィルムです。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5129/7524bk-01.jpg" width="600" height="596"><br><font size=3>シリーズ共通画像です。サイズをお確かめの上ご購入ください。</font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">※ガラス面以外には貼らないで下さい。<br>※ガラス戸や窓ガラスなど、屋外に面している場合は内側から、食器棚・本棚などの場合は外側から貼ってください。<br><br>●貼れる面<br>透明板ガラス(網入り・網無し)、くもりガラス(平らな面のみ)、凸凹ガラス(網入り網無し共に平らな面のみ)<br>●貼れない面<br>くもりガラス(ざらざら面)、凸凹ガラス(凸凹面)</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="595" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5129/7524bk-02.jpg"><br><font size="3">割れイメージ</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">ボールや投石などの災難・災害時に起こりうるガラスの破片の飛び散りを防ぎます。また、有害なUV(紫外線)を99％以上カット。尚、UVカットは全面貼りをした時に最大限の能力を発揮します。ガラス拭きをしてもキズがつきにくく、長年ご愛用いただけます。無色透明なので貼っても違和感がありません。透明板ガラス専用の防災フィルムです。</font></td></tr></table><br><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ボールや投石などの災難・災害時に起こりうるガラスの破片の飛び散りを防ぎます。また、有害なUV(紫外線)を99％以上カット。尚、UVカットは全面貼りをした時に最大限の能力を発揮します。ガラス拭きをしてもキズがつきにくく、長年ご愛用いただけます。無色透明なので貼っても違和感がありません。透明板ガラス専用の防災フィルムです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">92cm×185cm</font><br><font color="#333333" size="-1">個装サイズ：100×5×16cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：880g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">表面材:ハードコート(スリキズ防止処理)・ポリエステル(50μ)、粘着剤:アクリル酸エステル樹脂、保護フィルム</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">耐熱温度:80度</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">2枚組</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
