■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>布・紙が燃えにくくなる防炎スプレー</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5006an-01.jpg" width="600" height="678"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【素材説明】<br>防炎スプレーとは?<br>燃えやすい製品を燃え難くするものです。紙、布、繊維など火に接すると燃え広がる製品をスプレーするだけで、火がついても燃え広がらなくなります。<br><br>【ご使用方法】<br>紙(壁紙、障子ふすま)、カーテン、じゅうたん、エプロン作業服、天然繊維、吸水性素材に対し吹きかけ使用。<br>噴射対象品に正面より約10cm離し2回スプレーして下さい。<br>素材が紙、繊維の場合2回で10平方センチ程塗布出来ます。<br>この容器1本で、約181.5m2(畳10枚分)が目安です。<br><br>【ご使用上の注意】<br>●素材が十分に乾燥していることを確認の上、ご使用ください。<br>●塗布する際、ムラのないよう、ご使用ください。<br>●本品は希釈した場合、防炎効果が低下することがございます。<br>●洗濯すると防炎効果が低下することがございます。<br>●吸水性のない素材にはご使用を避けてください。<br>●直射日光や子供の手の届く場所に置かないで下さい。<br>●万一飲み込んだ場合、大量の水を飲ませて下さい。</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/5006an-02.jpg" width="600" height="842"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">ホウ素系化合物。燃えやすい製品を燃えにくくするものです。紙、布、繊維など火に接すると燃え広がる製品をスプレーするだけで、火がついて燃え広がりにくくなります。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ホウ素系化合物。燃えやすい製品を燃えにくくするものです。紙、布、繊維など火に接すると燃え広がる製品をスプレーするだけで、火がついて燃え広がりにくくなります。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">75mm径×23cm</font><br><font color="#333333" size="-1">個装サイズ：8×8×23cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">578g</font><br><font color="#333333" size="-1">個装重量：578g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">ホウ酸系化合物</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">1本あたりの使用可能範囲：約181.5m2(畳10枚分)</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
